-- use bump - collision module
-- use bump_debug - show debug info about collisions
local Bump = require("bump")
local PrintUI = require("printUI")
UP=0
DOWN=1
LEFT=2
RIGHT=3

--CELL_SIZE=256

BLOCK_COLOR=5
PLAYER_COLOR=6

local lastTime=time()
local world = Bump.newWorld(CELL_SIZE)
local blocks = {}

local function addBlock(block)
  blocks[#blocks+1] = block
  world:add(block,block.x,block.y,block.w,block.h)
end

local function drawBlocks()
  for _,block in ipairs(blocks) do
    --rect(block.x,block.y,block.w,block.h,block.color)
    spr(block.index, block.x, block.y, -1, block.scale, 0, 0, 1, 1)
  end
end

local function drawPlayer(player)
  --rect(player.x,player.y,player.w,player.h,player.color)
  spr(0, player.x, player.y, 1, 1, 0, 0, 1, 1)
end

local function addPlayer(player)
  world:add(player,player.x,player.y,player.w,player.h)
end

local function actionFilter(item, other)
  local kind = other.name
  print(kind)
  if     kind == 'water'   then return 'cross'
  elseif kind == 'wall'    then return 'slide'
  elseif kind == 'sand'    then return 'touch'
  elseif kind == 'red'     then return 'bounce'
  else return 'cross'
  end
end

local sand = {name="sand",x=100,y=100,w=24,h=24,scale = 3,index=1}
local water = {name="water",x=150,y=120,w=16,h=216,scale = 2,index=2}
local wall = {name="wall",x=60,y=20,w=40,h=40,scale = 5,index=3}
local red = {name="red",x=190,y=100,w=24,h=24,scale = 3,index=4}
local player = {name="Player",x=50,y=50,w=8,h=8,speed=0.05}

addBlock(sand)
addBlock(water)
addBlock(wall)
addBlock(red)
addPlayer(player)

function TIC()
  cls()
  map()
  PrintUI:printSpr("Hello World!!! :)",10,65,1)
  --bump_debug.draw(world)
  drawBlocks()
  drawPlayer(player)

  local delta_time = time()-lastTime
  lastTime = time()

  local speed = player.speed
  local delta_x, delta_y = 0, 0
  if btn(UP) then
    delta_y=-speed*delta_time
    PrintUI:printSpr("btn UP",150,10,1)
  end
  if btn(DOWN) then
    delta_y=speed*delta_time
    PrintUI:printSpr("btn DOWN",150,20,1)
  end
  if btn(LEFT) then
    delta_x=-speed*delta_time
    PrintUI:printSpr("btn LEFT",150,30,1)
  end
  if btn(RIGHT) then
    delta_x=speed*delta_time
    PrintUI:printSpr("btn RIGHT",150,40,1)
  end

  if delta_x~=0 or delta_y~=0 then
    player.x, player.y, cols, cols_len = world:move(player, player.x+delta_x, player.y+delta_y,actionFilter)
    --[[
    for i=1, cols_len do
      local col = cols[i]
      print(("col.other: %s, col.type: %s, col.normal: %d,%d")
        :format(col.other.name, col.type, col.normal.x, col.normal.y))
    end]]
  end
  
end
